import React, { Component } from 'react'

export default class FriendList extends Component {
  state = {
    friendList: [
      {
        id: '01',
        name: '赵',
        gender: '男',
      },
      {
        id: '02',
        name: '钱',
        gender: '男',
      },
      {
        id: '03',
        name: '孙',
        gender: '女',
      },
      {
        id: '04',
        name: '李',
        gender: '女',
      }
    ]
  }

  render() {
    const {friendList} = this.state;
    return (
      <div>
        {
          friendList.map((friend)=>{
            return (
              <div>
                <div>{friend.id}</div>
                <div>{friend.name}</div>
                <div>{friend.age}</div>
              </div>
            )
          })
        }
      </div>
    )
  }
}
